0b355769-581c-4985-a492-21288bd244c9	\N	3947da76-7ed7-4207-bde1-e81e2ab79ad3	d662eed0-5b63-4d82-bbd4-49374b6f7f27	SIGNED	{"fees": {"base_fee": 10, "hourly_fee": 20, "cancellation_fee": 30}, "thrive": {}, "contract": {"effective_date": "2026-01-28"}, "examiner": {"name": "Faiq Hussain", "email": "faiq+0050@buildmeapp.io"}, "province": "", "examinerName": "Faiq Hussain", "feeStructure": {"IMEFee": 0, "hourlyRate": 20, "paymentTerms": "", "cancellationFee": 30, "recordReviewFee": 0}, "renderedHtml": "<p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><div style=\\"text-align: center; display: block;\\"><img src=\\"https://assets.thriveassessmentcare.com/images/thriveLogo.png\\" alt=\\"Thrive Logo\\" style=\\"max-width: 200px; height: auto; display: inline-block;\\" /></div></span></p><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">EXAMINER AGREEMENT&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Effective Date: </strong>25 December 2025&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">This Agreement is made between Thrive IME Platform (\\"Platform\\") and Dr. Muhammad mahroz Abbas (\\"Examiner\\") located in Canada.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>1. PURPOSE&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">This Agreement outlines the terms under which the Examiner will provide Independent Medical Examination (IME) services through the Platform to claimants referred by insurance companies, legal firms, and other authorized organizations.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">2. <strong>FEE STRUCTURE&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner agrees to provide services at the following rates:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Service Type&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Fee&nbsp;</strong></span></p><table class=\\"border-collapse table-auto w-full\\" style=\\"min-width: 50px;\\"><colgroup><col style=\\"min-width: 25px;\\"><col style=\\"min-width: 25px;\\"></colgroup><tbody><tr><th style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top; background-color: #f3f4f6; font-weight: 600;\\" class=\\"border border-gray-300 p-2 bg-gray-100 font-semibold\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Name</strong></span></p></th><th style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top; background-color: #f3f4f6; font-weight: 600;\\" class=\\"border border-gray-300 p-2 bg-gray-100 font-semibold\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Fee</strong></span></p></th></tr><tr><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Hourly Rate (if applicable)</span></p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.hourly_fee\\">CA$20.00</span></span></p></td></tr><tr><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">IME Fee (in-clinic)&nbsp;</span></p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.base_fee\\">CA$10.00</span></span></p></td></tr></tbody></table><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Note: </strong>If hourly rate or report turnaround days are not applicable, those fields will appear empty in the generated contract.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>3. SERVICES TO BE PROVIDED&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner agrees to:&nbsp;</span><br class=\\"hard-break\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><br class=\\"hard-break\\"></p><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.some_key\\" class=\\"checkbox-group-variable\\" style=\\"margin: 12px 0px;\\"><label class=\\"font-semibold\\" style=\\"font-weight: 600; display: block; margin-bottom: 8px;\\">Some Key:</label><div class=\\"checkbox-options\\" style=\\"margin-top: 8px;\\"><div style=\\"margin-bottom: 4px; display: flex; align-items: center;\\"><span class=\\"checkbox-indicator\\" data-checkbox-value=\\"occupational_therapist\\" data-variable-key=\\"custom.some_key\\" style=\\"display: inline-block; width: 16px; height: 16px; border: 2px solid rgb(51, 51, 51); margin-right: 8px; vertical-align: middle; flex-shrink: 0;\\"></span><label style=\\"margin: 0px; font-weight: normal;\\">Occupational Therapist</label></div></div></div><p class=\\"\\"><br class=\\"hard-break\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Conduct thorough and impartial medical examinations of claimants&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Prepare detailed, objective medical reports within the agreed turnaround time&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain professional standards in accordance with medical licensing requirements&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Be available for testimony or clarification if required&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Respond to case assignments in a timely manner&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>4. PROFESSIONAL OBLIGATIONS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner shall:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain current medical licensure and malpractice insurance Comply with all applicable laws, regulations, and ethical guidelines&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Provide services in a professional, objective, and unbiased manner&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Keep the Platform informed of any changes to availability or credentials&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain patient confidentiality in accordance with applicable privacy laws&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>5. CONFIDENTIALITY&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner acknowledges that all information obtained during examinations is confidential and shall:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Not disclose any patient information except as required by law or authorized by the patient&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain secure storage of all patient records and examination materials&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Comply with all applicable privacy legislation including but not limited to PIPEDA&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Return or destroy all confidential materials upon completion of services&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>6. INDEPENDENT CONTRACTOR STATUS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner is an independent contractor and not an employee of the Platform. The Examiner is responsible for:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> All applicable taxes and business registrations&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Professional liability insurance&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Business expenses including office space, equipment, and supplies&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Compliance with all professional licensing requirements&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>7. TERM AND TERMINATION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">This Agreement shall remain in effect until terminated by either party with 30 days written notice. The Platform may terminate this Agreement immediately if the Examiner:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Breaches any material term of this Agreement&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Loses professional licensure or malpractice insurance&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Engages in professional misconduct&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Fails to maintain acceptable quality standards&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>8. LIABILITY AND INDEMNIFICATION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner agrees to maintain professional liability insurance with minimum coverage of $2,000,000 and shall indemnify the Platform against any claims arising from the Examiner's professional services or negligence.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>9. DISPUTE RESOLUTION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Any disputes arising from this Agreement shall be resolved through mediation, and if necessary, arbitration in accordance with the laws of the Province of.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>10. GENERAL PROVISIONS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> This Agreement constitutes the entire agreement between the parties&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Any amendments must be made in writing and signed by both parties&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> This Agreement shall be governed by the laws of&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> If any provision is found invalid, the remaining provisions shall continue in effect&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>ACKNOWLEDGMENT&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">By accepting cases through the Thrive IME Platform, the Examiner acknowledges that they have read, understood, and agree to be bound by the terms and conditions of this Agreement.&nbsp;</span></p><p class=\\"\\"></p><p class=\\"\\"><span style=\\"col