=\\"hard-break\\"><strong>AND:</strong> <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_name\\">Test Bakar</span><p class=\\"\\">,an independent regulated health professional and/or professional corporation, having its <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_city\\">St. Albert</span>principal place of business at (the <strong>Contractor</strong>) <br class=\\"hard-break\\">The Company and the Contractor are referred to individually as a <strong>Party</strong> and collectively as the <strong>Parties.</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>RECITALS</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\">A. The Company arranges and administers independent medical, psychological, functional, and rehabilitation-related examinations and assessments for insurers, employers, lawyers, tribunals, and other third-party referral sources. <br class=\\"hard-break\\">B. The Contractor is duly qualified, licensed, and experienced to provide independent examination services within the Contractors professional scope of practice. <br class=\\"hard-break\\">C. The Company wishes to retain the Contractor, and the Contractor wishes to provide such services, strictly as an independent contractor, subject to the terms and conditions of this Agreement.</p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\">NOW THEREFORE, in consideration of the mutual covenants contained herein, the Parties agree as follows:<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>1. NATURE OF RELATIONSHIP</strong> <br class=\\"hard-break\\">1.1 Independent Contractor <br class=\\"hard-break\\">The Contractor is an independent contractor and not an employee, agent, partner, or joint venturer of the Company. Nothing in this Agreement shall be construed to create an employment relationship. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1.2 No Authority <br class=\\"hard-break\\">The Contractor has no authority to bind the Company, incur obligations on behalf of the Company, or represent themselves as an employee or agent of the Company. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1.3 Taxes and Deductions <br class=\\"hard-break\\">The Contractor is solely responsible for all taxes, remittances, statutory deductions, premiums, and contributions arising from amounts paid under this Agreement, including but not limited to income tax, HST, CPP, EI, WSIB, and EHT.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><br class=\\"hard-break\\"><strong>2. SCOPE OF SERVICES</strong> <br class=\\"hard-break\\">2.1 IME Services <br class=\\"hard-break\\">The Contractor shall provide independent examination-related services, which may include in-person or virtual examinations, file reviews, addenda, clarifications, and participation in multidisciplinary assessments, strictly within the Contractors professional scope of practice, as further defined in Schedule A (Discipline &amp; Scope of Practice).<br class=\\"hard-break\\"><br class=\\"hard-break\\">2.2 No Treatment Relationship <br class=\\"hard-break\\">The Contractor shall not provide treatment, therapy, medical advice, rehabilitation services, or ongoing care to any examinee and shall not establish a therapeutic, physicianpatient, or clinicianpatient relationship.<br class=\\"hard-break\\"><br class=\\"hard-break\\">2.3 Consent and Identification <br class=\\"hard-break\\">The Contractor shall obtain informed consent prior to each assessment and verify examinee identity in accordance with applicable professional, legal, and regulatory standards.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>3. PROFESSIONAL INDEPENDENCE, OBJECTIVITY, AND DUTY OF IMPARTIALITY</strong> <br class=\\"hard-break\\">3.1 Independence of Opinion <br class=\\"hard-break\\">The Contractor shall render opinions that are honest, impartial, objective, and independent, based solely on professional expertise, examination findings, and reviewed documentation.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\">3.2 No Outcome Influence <br class=\\"hard-break\\">Compensation under this Agreement is not contingent on the substance, outcome, or conclusions of any opinion, determination, or report. <br class=\\"hard-break\\"><br class=\\"hard-break\\">3.3 No Direction on Conclusions <br class=\\"hard-break\\">The Company shall not direct, influence, or interfere with the Contractors professional opinions or conclusions.<br class=\\"hard-break\\"><br class=\\"hard-break\\">3.4 Duty of Independence and Impartiality (Rule 53.03Style Clause) <br class=\\"hard-break\\">The Contractor acknowledges that where any opinion, report, or assessment prepared under this Agreement is relied upon in a judicial, arbitral, or administrative proceeding, the Contractors primary duty is to provide opinions that are fair, objective, and non-partisan. <br class=\\"hard-break\\">The Contractor agrees that such opinions shall be given in accordance with the Contractors professional expertise and independent judgment, and not as an advocate for the Company, any referral source, insurer, employer, examinee, or any other party. <br class=\\"hard-break\\">The Contractor further acknowledges that this duty of independence and impartiality prevails over any obligation owed to the Company or any referral source with respect to the substance of the opinions expressed.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>4. REGULATORY COMPLIANCE </strong><br class=\\"hard-break\\">4.1 Licensure and Good Standing <br class=\\"hard-break\\">The Contractor represents and warrants that they are, and shall remain throughout the term of this Agreement, duly licensed, registered, and in good standing with the applicable regulatory College(s). <br class=\\"hard-break\\"><br class=\\"hard-break\\">4.2 Mandatory Disclosure <br class=\\"hard-break\\">The Contractor shall immediately notify the Company in writing of:<br class=\\"hard-break\\"> any investigation, complaint, inquiry, restriction, suspension, or disciplinary action;</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"> any criminal charge or conviction relevant to professional practice; or <br class=\\"hard-break\\"> any loss, limitation, or change in professional registration, certification, or hospital privileges. <br class=\\"hard-break\\"><br class=\\"hard-break\\">4.3 Standards of Practice <br class=\\"hard-break\\">The Contractor shall comply with all applicable laws, regulations, College standards, professional guidelines, and ethical obligations.</p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>5. CONFLICT OF INTEREST</strong> <br class=\\"hard-break\\">5.1 No Conflict <br class=\\"hard-break\\">The Contractor shall not conduct an assessment where a conflict of interest exists, including prior treatment, personal relationship, or financial interest involving the examinee. <br class=\\"hard-break\\"><br class=\\"hard-break\\">5.2 Disclosure and Reassignment <br class=\\"hard-break\\">Any actual or potential conflict must be disclosed immediately. The Company may reassign or cancel the assessment without penalty.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>6. CONFIDENTIALITY AND PRIVACY </strong><br class=\\"hard-break\\">6.1 Confidential Information The Contractor shall keep confidential all information relating to the Company, referral sources, and examinees, except as required by law. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.2 Privacy Legislation <br class=\\"hard-break\\">The Contractor shall comply with all applicable privacy legislation, including the Personal Health Information Protection Act (Ontario) and PIPEDA, and shall implement appropriate administrative, technical, and physical safeguards. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.3 Use Limitation <br class=\\"hard-break\\">Personal health information shall be used solely for the purpose of fulfilling obligations under this Agreement and shall not be retained, reused, or disclosed for any other purpose. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.4 Breach Notification <br class=\\"hard-break\\">Any actual or suspected privacy breach shall be reported to the Company immediately upon discovery.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\"><strong>7. QUALITY ASSURANCE AND REPORT INTEGRITY </strong><br class=\\"hard-break\\">7.1 Limited QA Authority <br class=\\"hard-break\\">The Contractor acknowledges that the Company may conduct quality assurance review for formatting, clarity, internal consistency, administrative accuracy, and statutory or regulatory language compliance, as further set out in Schedule C (QA &amp; Report Integrity). <br class=\\"hard-break\\"><br class=\\"hard-break\\">7.2 No Opinion Alteration <br class=\\"hard-break\\">Under no circumstances shall the Company alter the Contractors clinical opinions or conclusions without the Contractors express written consent.<br class=\\"hard-break\\"><br class=\\"hard-break\\">7.3 Clarifications <br class=\\"hard-break\\">The Contractor shall cooperate reasonably and promptly in providing clarifications or corrections consistent with Schedule C.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>8. FEES AND PAYMENT</strong> <br class=\\"hard-break\\">8.1 Fees <br class=\\"hard-break\\">Fees and billing terms are set out in Schedule B (Fees &amp; Billing).<br class=\\"hard-break\\"><br class=\\"hard-break\\">8.2 Invoicing <br class=\\"hard-break\\">Invoices shall be submitted in accordance with Schedule B. Payment is conditional upon completion of services and submission of compliant deliverables. <br class=\\"hard-break\\"><br class=\\"hard-break\\">8.3 No Additional Compensation <br class=\\"hard-break\\">No compensation shall be payable unless expressly set out in Schedule B.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>9. INTELLECTUAL PROPERTY </strong><br class=\\"hard-break\\">9.1 Work Product Ownership <br class=\\"hard-break\\">All reports and deliverables prepared under this Agreement are commissioned works and shall be the property of the Company upon payment.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\">9.2 Professional Authorship <br class=\\"hard-break\\">Nothing in this Agreement alters the Contractors professional responsibility for, or authorship of, the opinions expressed in any report. <br class=\\"hard-break\\"><br class=\\"hard-break\\">9.3 Restriction on Reuse <br class=\\"hard-break\\">The Contractor shall not reuse, publish, or disclose reports prepared under this Agreement without the Companys prior written consent, except as required by law.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>10. INSURANCE AND INDEMNIFICATION </strong><br class=\\"hard-break\\">10.1 Insurance <br class=\\"hard-break\\">The Contractor shall maintain professional liability insurance in amounts customary for their profession and provide proof upon request. <br class=\\"hard-break\\"><br class=\\"hard-break\\">10.2 Indemnification by Contractor <br class=\\"hard-break\\">The Contractor shall indemnify and hold harmless the Company from all claims, losses, damages, costs, and expenses arising from the Contractors professional acts, omissions, breaches of this Agreement, or violations of law. <br class=\\"hard-break\\"><br class=\\"hard-break\\">10.3 Indemnification by Company <br class=\\"hard-break\\">The Company shall indemnify the Contractor for losses arising solely from the Companys negligence or willful misconduct.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>11. TERMINATION</strong> <br class=\\"hard-break\\">11.1 Termination Without Cause</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">Either Party may terminate this Agreement upon thirty (30) days written notice. <br class=\\"hard-break\\"><br class=\\"hard-break\\">11.2 Immediate Termination <br class=\\"hard-break\\">The Company may terminate this Agreement immediately upon: <br class=\\"hard-break\\"> loss or restriction of licensure; <br class=\\"hard-break\\"> material breach of this Agreement; <br class=\\"hard-break\\"> privacy breach or professional misconduct; or <br class=\\"hard-break\\"> conduct reasonably bringing the Company into disrepute.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\">11.3 Survival <br class=\\"hard-break\\">Confidentiality, privacy, indemnity, ownership, and duty of independence provisions survive termination.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>12. NON-SOLICITATION</strong> <br class=\\"hard-break\\">During the term of this Agreement and for twelve (12) months thereafter, the Contractor shall not solicit the Companys referral sources or staff, except through the Company.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>13. GOVERNING LAW AND JURISDICTION </strong><br class=\\"hard-break\\">This Agreement shall be governed by the laws of the Province of Ontario and the laws of Canada applicable therein. The Parties attorn to the exclusive jurisdiction of the courts of Ontario.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>14. GENERAL </strong><br class=\\"hard-break\\">14.1 Entire Agreement <br class=\\"hard-break\\">This Agreement, together with its Schedules, constitutes the entire agreement between the Parties. <br class=\\"hard-break\\"><br class=\\"hard-break\\">14.2 Amendments <br class=\\"hard-break\\">Any amendment must be in writing and signed by both Parties. <br class=\\"hard-break\\"><br class=\\"hard-break\\">14.3 Severability <br class=\\"hard-break\\">If any provision is held invalid, the remaining provisions remain in full force. <br class=\\"hard-break\\"><br class=\\"hard-break\\">14.4 Counterparts and Electronic Execution <br class=\\"hard-break\\">This Agreement may be executed in counterparts and by electronic signature.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>SCHEDULES</strong> <br class=\\"hard-break\\"> Schedule A  Discipline &amp; Scope of Practice <br class=\\"hard-break\\"> Schedule B  Fees &amp; Billing</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"> Schedule C  Quality Assurance &amp; Report Integrity <br class=\\"hard-break\\"> Schedule D  Office, Safety &amp; Accessibility <br class=\\"hard-break\\"> Schedule E  Credentials, Insurance &amp; Disclosure</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>EXECUTION</strong> <br class=\\"hard-break\\">IN WITNESS WHEREOF, the Parties have executed this Agreement as of the Effective Date. <br class=\\"hard-break\\"><strong>THRIVE ASSESSMENT &amp; CARE INC.</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">By:__________________________</p><p class=\\"\\">Name: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.thrive_admin_name\\">Bashir Syed</span><br class=\\"hard-break\\">Title: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.thrive_admin_title\\">Admin</span><br class=\\"hard-break\\"><br class=\\"hard-break\\">Date:<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>Contractor</strong></p><p class=\\"\\">By:</p><p class=\\"\\"><span data-signature=\\"examiner\\">________________________</span></p><p class=\\"\\">Name: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_name\\">Test Bakar</span></p><p class=\\"\\">Title(if applicable)</p><p class=\\"\\">Date: ________________________</p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>SCHEDULE A</strong></h3><p class=\\"\\"></p><p class=\\"\\"><strong>DISCIPLINE &amp; SCOPE OF PRACTICE</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement.<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>1. Contractor Discipline</strong></p><p class=\\"\\"><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.primary_discipline\\"><span data-checkbox-value=\\"occupational_therapist\\"></span> Occupational Therapist<br/><span data-checkbox-value=\\"physiotherapist\\"></span> Physiotherapist <br/><span data-checkbox-value=\\"chiropractor\\"></span> Chiropractor <br/><span data-checkbox-value=\\"physician\\"></span> Physician<br/><span data-checkbox-value=\\"psychologist\\"></span> Psychologist<br/><span data-checkbox-value=\\"neuropsychologist\\"></span> Neuropsychologist<br/><span data-checkbox-value=\\"other\\"></span> Other</div><br class=\\"hard-break\\"><br class=\\"hard-break\\">Regulatory College(s): <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.regulatory_college_s\\">Bla Bla Bla ...</span><br class=\\"hard-break\\">License / Registration Number(s): <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.license_registration_number_s\\">Bla Bla Bla .....</span></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>2. Permitted Scope of IME Opinions</strong><br class=\\"hard-break\\">The Contractor is authorized to provide independent medical, psychological, functional, or rehabilitation-related opinions within the Contractors professional scope of practice, training, competence, and regulatory authority, as applicable to the purpose of the referral. Such opinions may be provided in connection with assessments conducted for, including but not limited to: <br class=\\"hard-break\\">(a) statutory accident benefits claims arising from motor vehicle accidents, including determinations under the Statutory Accident Benefits Schedule (SABS); <br class=\\"hard-break\\">(b) workplace injuries or occupational claims, including insurer, employer, or administrative referrals; <br class=\\"hard-break\\">(c) insurance-related claims outside of SABS, including disability, tort, slip-and-fall, premises liability, or similar matters; and <br class=\\"hard-break\\">(d) other medical-legal, insurance, or administrative assessment purposes, as defined by the referral source and permitted by the Contractors professional scope. Where applicable, the Contractor may provide opinions addressing the necessity, reasonableness, appropriateness, or relationship of benefits, services, limitations, or restrictions, only to the extent that such opinions fall within the Contractors regulated</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\">scope of practice and are permitted under the applicable statutory, contractual, or policy framework governing the referral. <br class=\\"hard-break\\">In all cases, the Contractors opinions shall be limited to matters properly within their professional scope of practice and shall not extend to diagnoses, determinations, or conclusions reserved to other regulated professionals or outside the Contractors regulatory authority.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Explicit Scope Exclusions <br class=\\"hard-break\\">Unless expressly permitted by the Contractors profession, training, and applicable regulatory College standards, the Contractor shall not provide treatment, therapy, rehabilitation, or therapeutic intervention of any kind; prescribe medication, recommend medication changes, or provide medication management opinions; provide diagnoses, determinations, or opinions outside the Contractors regulated scope of practice or professional authority; provide legal conclusions, determinations of liability, or opinions on legal causation; or act, directly or indirectly, as an advocate for any party, referral source, insurer, employer, or examinee. The Contractor shall not comment on credibility, malingering, exaggeration, or secondary gain unless such commentary is expressly permitted within the Contractors professional scope of practice and is supported by objective findings, accepted methodologies, and documented clinical evidence.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p cla