ass=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Fee&nbsp;</strong></span></p><table class=\\"border-collapse table-auto w-full\\" style=\\"min-width: 50px;\\"><colgroup><col style=\\"min-width: 25px;\\"><col style=\\"min-width: 25px;\\"></colgroup><tbody><tr><th style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top; background-color: #f3f4f6; font-weight: 600;\\" class=\\"border border-gray-300 p-2 bg-gray-100 font-semibold\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Name</strong></span></p></th><th style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top; background-color: #f3f4f6; font-weight: 600;\\" class=\\"border border-gray-300 p-2 bg-gray-100 font-semibold\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Fee</strong></span></p></th></tr><tr><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Hourly Rate (if applicable)</span></p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.hourly_fee\\">CA$20.00</span></span></p></td></tr><tr><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">IME Fee (in-clinic)&nbsp;</span></p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.base_fee\\">CA$10.00</span></span></p></td></tr></tbody></table><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Note: </strong>If hourly rate or report turnaround days are not applicable, those fields will appear empty in the generated contract.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>3. SERVICES TO BE PROVIDED&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner agrees to:&nbsp;</span><br class=\\"hard-break\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><br class=\\"hard-break\\"></p><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.some_key\\" class=\\"checkbox-group-variable\\" style=\\"margin: 12px 0px;\\"><label class=\\"font-semibold\\" style=\\"font-weight: 600; display: block; margin-bottom: 8px;\\">Some Key:</label><div class=\\"checkbox-options\\" style=\\"margin-top: 8px;\\"><div style=\\"margin-bottom: 4px; display: flex; align-items: center;\\"><span class=\\"checkbox-indicator\\" data-checkbox-value=\\"occupational_therapist\\" data-variable-key=\\"custom.some_key\\" style=\\"display: inline-block; width: 16px; height: 16px; border: 2px solid rgb(51, 51, 51); margin-right: 8px; vertical-align: middle; flex-shrink: 0;\\"></span><label style=\\"margin: 0px; font-weight: normal;\\">Occupational Therapist</label></div></div></div><p class=\\"\\"><br class=\\"hard-break\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Conduct thorough and impartial medical examinations of claimants&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Prepare detailed, objective medical reports within the agreed turnaround time&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain professional standards in accordance with medical licensing requirements&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Be available for testimony or clarification if required&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Respond to case assignments in a timely manner&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>4. PROFESSIONAL OBLIGATIONS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner shall:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain current medical licensure and malpractice insurance Comply with all applicable laws, regulations, and ethical guidelines&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Provide services in a professional, objective, and unbiased manner&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Keep the Platform informed of any changes to availability or credentials&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain patient confidentiality in accordance with applicable privacy laws&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>5. CONFIDENTIALITY&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner acknowledges that all information obtained during examinations is confidential and shall:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Not disclose any patient information except as required by law or authorized by the patient&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain secure storage of all patient records and examination materials&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Comply with all applicable privacy legislation including but not limited to PIPEDA&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Return or destroy all confidential materials upon completion of services&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>6. INDEPENDENT CONTRACTOR STATUS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner is an independent contractor and not an employee of the Platform. The Examiner is responsible for:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> All applicable taxes and business registrations&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Professional liability insurance&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Business expenses including office space, equipment, and supplies&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Compliance with all professional licensing requirements&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>7. TERM AND TERMINATION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">This Agreement shall remain in effect until terminated by either party with 30 days written notice. The Platform may terminate this Agreement immediately if the Examiner:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Breaches any material term of this Agreement&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Loses professional licensure or malpractice insurance&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Engages in professional misconduct&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Fails to maintain acceptable quality standards&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>8. LIABILITY AND INDEMNIFICATION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner agrees to maintain professional liability insurance with minimum coverage of $2,000,000 and shall indemnify the Platform against any claims arising from the Examiner's professional services or negligence.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>9. DISPUTE RESOLUTION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Any disputes arising from this Agreement shall be resolved through mediation, and if necessary, arbitration in accordance with the laws of the Province of.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>10. GENERAL PROVISIONS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> This Agreement constitutes the entire agreement between the parties&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Any amendments must be made in writing and signed by both parties&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> This Agreement shall be governed by the laws of&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> If any provision is found invalid, the remaining provisions shall continue in effect&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>ACKNOWLEDGMENT&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">By accepting cases through the Thrive IME Platform, the Examiner acknowledges that they have read, understood, and agree to be bound by the terms and conditions of this Agreement.&nbsp;</span></p><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span data-signature=\\"examiner\\">________________________</span></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Examiner Signature&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Date: </strong>________________________</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>For Platform:&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Authorized Signatory&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Reviewed At:&nbsp;</strong></span></p><p class=\\"\\"></p><p class=\\"\\" style=\\"text-align: center;\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"thrive.copyright\\"> Copyright 2026 | Thrive Assessment & Care | All Rights Reserved</span></span></p>", "effectiveDate": "2026-01-15", "renderedHtmlTimestamp": "2026-01-15T20:15:02.626Z"}		2026-01-15 20:15:03.543+00	\N	2026-01-15 20:15:57.609+00	\N	\N	\N	\N	c2e40e75-1e77-4072-8b9c-345e78dbf7a4	2026-01-15 20:14:56.589+00	2026-01-15 20:17:22.931+00	1x4D7GG_fvJSBlWgOFqlbHzsQUdhni7vSA3Nwupr1abY	https://docs.google.com/document/d/1x4D7GG_fvJSBlWgOFqlbHzsQUdhni7vSA3Nwupr1abY/edit	f	\N	signed-contracts/588e7c10-f112-4490-91ef-b8283de5a484/9a98e124-1cc2-40d2-920f-a71338972af0.html	0b5e79d819fd77a76819efdfb436f00c8f42e8031dd1692ddf3e3a0e1fd2a465	contracts/contracts/588e7c10-f112-4490-91ef-b8283de5a484/unsigned-1768508099612.html	\N	555b128f-beab-458e-ab3f-5638dc69b5be	signed-contracts/588e7c10-f112-4490-91ef-b8283de5a484/46dd009b-f454-4c51-87da-014e0b6d51d1.pdf	a31ccf3a977e4365051650c11c10095317472b9e4c9796158f18dad18d3b22e1	\N	\N	e5b720b6-e18c-4f2b-97bd-d5e5bf9b510d	{"custom": {}, "contract": {"review_date": "2026-01-15", "effective_date": "2026-01-15"}, "examiner": {"name": "Bilal Hasan", "email": "bilalhsntest@gmail.com", "signature": "data:image/png;base64,", "checkbox_selections": {}, "signature_date_time": "2026-01-15T20:15:55.913Z"}, "fees_overrides": {"base_fee": 10, "hourly_fee": 20, "cancellation_fee": 30}}	2026-01-15 00:00:00+00
2a4b10c6-a41a-43fe-875d-19369be88653	\N	47252244-a710-468e-9436-9ce2bbdd8822	99f4de7e-5d8d-4818-9750-d74942c1c4f5	SIGNED	{"fees": {"inperson_fee": 15, "payment_timing": "8", "cat_specialized": 45, "virtual_ime_fee": 20, "file_paper_review": 23, "no_show_percentage": "4", "clarification_no_fee": "included", "cancellation_percentage": "5", "addendum_new_evidence_only": 30, "multidisciplinary_crossreview": "included"}, "thrive": {}, "contract": {"effective_date": "2026-01-15"}, "examiner": {"name": "Aiza Gull", "email": "aizag485@gmail.com"}, "province": "", "examinerName": "Aiza Gull", "feeStructure": {"IMEFee": 20, "hourlyRate": 0, "paymentTerms": "8", "cancellationFee": 5, "recordReviewFee": null}, "renderedHtml": "<p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\" style=\\"text-align: center;\\"></p><p class=\\"\\"></p><h2 style=\\"text-align: center;\\">INDEPENDENT MEDICAL EXAMINATION (IME) CONTRACTOR AGREEMENT</h2><p class=\\"\\"><br class=\\"hard-break\\">This Independent Medical Examination Contractor Agreement (the Agreement) is made as of <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"contract.effective_date\\">2026-01-15</span>(the <strong>Effective Date</strong>)</p><p class=\\"\\"></p><p class=\\"\\"><strong>BETWEEN:</strong><br class=\\"hard-break\\"><strong>Thrive Assessment &amp; Care Inc., </strong><br class=\\"hard-break\\">an Ontario corporation, <br class=\\"hard-break\\">having its principal place of business at <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"thrive.company_address\\">1 Dundas St West, Suite 2500, Toronto, ON., M5G 1Z3</span>(the <strong>Company</strong>) <br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>AND:</strong> <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_name\\">Aiza Gull</span><p class=\\"\\">,an independent regulated health professional and/or professional corporation, having its <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_city\\">Chilliwack</span>principal place of business at (the <strong>Contractor</strong>) <br class=\\"hard-break\\">The Company and the Contractor are referred to individually as a <strong>Party</strong> and collectively as the <strong>Parties.</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>RECITALS</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\">A. The Company arranges and administers independent medical, psychological, functional, and rehabilitation-related examinations and assessments for insurers, employers, lawyers, tribunals, and other third-party referral sources. <br class=\\"hard-break\\">B. The Contractor is duly qualified, licensed, and experienced to provide independent examination services within the Contractors professional scope of practice. <br class=\\"hard-break\\">C. The Company wishes to retain the Contractor, and the Contractor wishes to provide such services, strictly as an independent contractor, subject to the terms and conditions of this Agreement.</p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\">NOW THEREFORE, in consideration of the mutual covenants contained herein, the Parties agree as follows:<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>1. NATURE OF RELATIONSHIP</strong> <br class=\\"hard-break\\">1.1 Independent Contractor <br class=\\"hard-break\\">The Contractor is an independent contractor and not an employee, agent, partner, or joint venturer of the Company. Nothing in this Agreement shall be construed to create an employment relationship. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1.2 No Authority <br class=\\"hard-break\\">The Contractor has no authority to bind the Company, incur obligations on behalf of the Company, or represent themselves as an employee or agent of the Company. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1.3 Taxes and Deductions <br class=\\"hard-break\\">The Contractor is solely responsible for all taxes, remittances, statutory deductions, premiums, and contributions arising from amounts paid under this Agreement, including but not limited to income tax, HST, CPP, EI, WSIB, and EHT.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><br class=\\"hard-break\\"><strong>2. SCOPE OF SERVICES</strong> <br class=\\"hard-break\\">2.1 IME Services <br class=\\"hard-break\\">The Contractor shall provide independent examination-related services, which may include in-person or virtual examinations, file reviews, addenda, clarifications, and participation in multidisciplinary assessments, strictly within the Contractors professional scope of practice, as further defined in Schedule A (Discipline &amp; Scope of Practice).<br class=\\"hard-break\\"><br class=\\"hard-break\\">2.2 No Treatment Relationship <br class=\\"hard-break\\">The Contractor shall not provide treatment, therapy, medical advice, rehabilitation services, or ongoing care to any examinee and shall not establish a therapeutic, physicianpatient, or clinicianpatient relationship.<br class=\\"hard-break\\"><br class=\\"hard-break\\">2.3 Consent and Identification <br class=\\"hard-break\\">The Contractor shall obtain informed consent prior to each assessment and verify examinee identity in accordance with applicable professional, legal, and regulatory standards.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>3. PROFESSIONAL INDEPENDENCE, OBJECTIVITY, AND DUTY OF IMPARTIALITY</strong> <br class=\\"hard-break\\">3.1 Independence of Opinion <br class=\\"hard-break\\">The Contractor shall render opinions that are honest, impartial, objective, and independent, based solely on professional expertise, examination findings, and reviewed documentation.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\">3.2 No Outcome Influence <br class=\\"hard-break\\">Compensation under this Agreement is not contingent on the substance, outcome, or conclusions of any opinion, determination, or report. <br class=\\"hard-break\\"><br class=\\"hard-break\\">3.3 No Direction on Conclusions <br class=\\"hard-break\\">The Company shall not direct, influence, or interfere with the Contractors professional opinions or conclusions.<br class=\\"hard-break\\"><br class=\\"hard-break\\">3.4 Duty of Independence and Impartiality (Rule 53.03Style Clause) <br class=\\"hard-break\\">The Contractor acknowledges that where any opinion, report, or assessment prepared under this Agreement is relied upon in a judicial, arbitral, or administrative proceeding, the Contractors primary duty is to provide opinions that are fair, objective, and non-partisan. <br class=\\"hard-break\\">The Contractor agrees that such opinions shall be given in accordance with the Contractors professional expertise and independent judgment, and not as an advocate for the Company, any referral source, insurer, employer, examinee, or any other party. <br class=\\"hard-break\\">The Contractor further acknowledges that this duty of independence and impartiality prevails over any obligation owed to the Company or any referral source with respect to the substance of the opinions expressed.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>4. REGULATORY COMPLIANCE </strong><br class=\\"hard-break\\">4.1 Licensure and Good Standing <br class=\\"hard-break\\">The Contractor represents and warrants that they are, and shall remain throughout the term of this Agreement, duly licensed, registered, and in good standing with the applicable regulatory College(s). <br class=\\"hard-break\\"><br class=\\"hard-break\\">4.2 Mandatory Disclosure <br class=\\"hard-break\\">The Contractor shall immediately notify the Company in writing of:<br class=\\"hard-break\\"> any investigation, complaint, inquiry, restriction, suspension, or disciplinary action;</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"> any criminal charge or conviction relevant to professional practice; or <br class=\\"hard-break\\"> any loss, limitation, or change in professional registration, certification, or hospital privileges. <br class=\\"hard-break\\"><br class=\\"hard-break\\">4.3 Standards of Practice <br class=\\"hard-break\\">The Contractor shall comply with all applicable laws, regulations, College standards, professional guidelines, and ethical obligations.</p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>5. CONFLICT OF INTEREST</strong> <br class=\\"hard-break\\">5.1 No Conflict <br class=\\"hard-break\\">The Contractor shall not conduct an assessment where a conflict of interest exists, including prior treatment, personal relationship, or financial interest involving the examinee. <br class=\\"hard-break\\"><br class=\\"hard-break\\">5.2 Disclosure and Reassignment <br class=\\"hard-break\\">Any actual or potential conflict must be disclosed immediately. The Company may reassign or cancel the assessment without penalty.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>6. CONFIDENTIALITY AND PRIVACY </strong><br class=\\"hard-break\\">6.1 Confidential Information The Contractor shall keep confidential all information relating to the Company, referral sources, and examinees, except as required by law. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.2 Privacy Legislation <br class=\\"hard-break\\">The Contractor shall comply with all applicable privacy legislation, including the Personal Health Information Protection Act (Ontario) and PIPEDA, and shall implement appropriate administrative, technical, and physical safeguards. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.3 Use Limitation <br class=\\"hard-break\\">Personal health information shall be used solely for the purpose of fulfilling obligations under this Agreement and shall not be retained, reused, or disclosed for any other purpose. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.4 Breach Notification <br class=\\"hard-break\\">Any actual or suspected privacy breach shall be reported to the Company immediately upon discovery.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\"><strong>7. QUALITY ASSURANCE AND REPORT INTEGRITY </strong><br class=\\"hard-break\\">7.1 Limited QA Authority <br class=\\"hard-break\\">The Contractor acknowledges that the Company may conduct quality assurance review for formatting, clarity, internal consistency, administrative accuracy, and statutory or regulatory language compliance, as further set out in Schedule C (QA &amp; Report Integrity). <br class=\\"hard-break\\"><br class=\\"hard-break\\">7.2 No Opinion Alteration <br class=\\"hard-break\\">Under no circumstances shall the Company alter the Contractors clinical opinions or conclusions without the Contractors express written consent.<br class=\\"hard-break\\"><br class=\\"hard-break\\">7.3 Clarifications <br class=\\"hard-break\\">The Contractor shall cooperate reasonably and promptly in providing clarifications or corrections consistent with Schedule C.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>8. FEES AND PAYMENT</strong> <br class=\\"hard-break\\">8.1 Fees <br class=\\"hard-break\\">Fees and billing terms are set out in Schedule B (Fees &amp; Billing).<br class=\\"hard-break\\"><br class=\\"hard-break\\">8.2 Invoicing <br class=\\"hard-break\\">Invoices shall be submitted in accordance with Schedule B. Payment is conditional upon completion of services and submission of compliant deliverables. <br class=\\"hard-break\\"><br class=\\"hard-break\\">8.3 No Additional Compensation <br class=\\"hard-break\\">No compensation shall be payable unless expressly set out in Schedule B.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>9. INTELLECTUAL PROPERTY </strong><br class=\\"hard-break\\">9.1 Work Product Ownership <br class=\\"hard-break\\">All reports and deliverables prepared under this Agreement are commissioned works and shall be the property of the Company upon payment.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\">9.2 Professional Authorship <br class=\\"hard-break\\">Nothing in this Agreement alters the Contractors professional responsibility for, or authorship of, the opinions expressed in any report. <br class=\\"hard-break\\"><br class=\\"hard-break\\">9.3 Restriction on Reuse <br class=\\"hard-break\\">The Contractor shall not reuse, publish, or disclose reports prepared under this Agreement without the Companys prior written consent, except as required by law.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>10. INSURANCE AND INDEMNIFICATION </strong><br class=\\"hard-break\\">10.1 Insurance <br class=\\"hard-break\\">The Contractor shall maintain professional liability insurance in amounts customary for their profession and provide proof upon request. <br class=\\"hard-break\\"><br class=\\"hard-break\\">10.2 Indemnification by Contractor <br class=\\"hard-break\\">The Contractor shall indemnify and hold harmless the Company from all claims, losses, damages, costs, and expenses arising from the Contractors professional acts, omissions, breaches of this Agreement, or violations of law. <br class=\\"hard-break\\"><br class=\\"hard-break\\">10.3 Indemnification by Company <br class=\\"hard-break\\">The Company shall indemnify the Contractor for losses arising solely from the Companys negligence or willful misconduct.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>11. TERMINATION</strong> <br class=\\"hard-break\\">11.1 Termination Without Cause</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">Either Party may terminate this Agreement upon thirty (30) days written notice. <br class=\\"hard-break\\"><br class=\\"hard-break\\">11.2 Immediate Termination <br class=\\"hard-break\\">The Company may terminate this Agreement immediately upon: <br class=\\"hard-break\\"> loss or restriction of licensure; <br class=\\"hard-break\\"> material breach of this Agreement; <br class=\\"hard-break\\"> privacy breach or professional misconduct; or <br class=\\"hard-break\\"> conduct reasonably bringing the Company into disrepute.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\">11.3 Survival <br class=\\"hard-break\\">Confidentiality, privacy, indemnity, ownership, and duty of independence provisions survive termination.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>12. NON-SOLICITATION</strong> <br class=\\"hard-break\\">During the term of this Agreement and for twelve (12) months thereafter, the Contractor shall not solicit the Companys referral sources or staff, except through the Company.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>13. GOVERNING LAW AND JURISDICTION </strong><br class=\\"hard-break\\">This Agreement shall be governed by the laws of the Province of Ontario and the laws of Canada applicable therein. The Parties attorn to the exclusive jurisdiction of the courts of Ontario.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p 