\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"> Schedule C  Quality Assurance &amp; Report Integrity <br class=\\"hard-break\\"> Schedule D  Office, Safety &amp; Accessibility <br class=\\"hard-break\\"> Schedule E  Credentials, Insurance &amp; Disclosure</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>EXECUTION</strong> <br class=\\"hard-break\\">IN WITNESS WHEREOF, the Parties have executed this Agreement as of the Effective Date. <br class=\\"hard-break\\"><strong>THRIVE ASSESSMENT &amp; CARE INC.</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">By:__________________________</p><p class=\\"\\">Name: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.thrive_admin_name\\">Bashir Syed</span><br class=\\"hard-break\\">Title: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.thrive_admin_title\\">Admin</span><br class=\\"hard-break\\"><br class=\\"hard-break\\">Date:<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>Contractor</strong></p><p class=\\"\\">By:</p><p class=\\"\\"><span data-signature=\\"examiner\\">________________________</span></p><p class=\\"\\">Name: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_name\\">Aiza Gull</span></p><p class=\\"\\">Title(if applicable)</p><p class=\\"\\">Date: ________________________</p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>SCHEDULE A</strong></h3><p class=\\"\\"></p><p class=\\"\\"><strong>DISCIPLINE &amp; SCOPE OF PRACTICE</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement.<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>1. Contractor Discipline</strong></p><p class=\\"\\"><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.primary_discipline\\"><span data-checkbox-value=\\"occupational_therapist\\"></span> Occupational Therapist<br/><span data-checkbox-value=\\"physiotherapist\\"></span> Physiotherapist <br/><span data-checkbox-value=\\"chiropractor\\"></span> Chiropractor <br/><span data-checkbox-value=\\"physician\\"></span> Physician<br/><span data-checkbox-value=\\"psychologist\\"></span> Psychologist<br/><span data-checkbox-value=\\"neuropsychologist\\"></span> Neuropsychologist<br/><span data-checkbox-value=\\"other\\"></span> Other</div><br class=\\"hard-break\\"><br class=\\"hard-break\\">Regulatory College(s): <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.regulatory_college_s\\">Bla Bla Bla ...</span><br class=\\"hard-break\\">License / Registration Number(s): <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.license_registration_number_s\\">Bla Bla Bla .....</span></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>2. Permitted Scope of IME Opinions</strong><br class=\\"hard-break\\">The Contractor is authorized to provide independent medical, psychological, functional, or rehabilitation-related opinions within the Contractors professional scope of practice, training, competence, and regulatory authority, as applicable to the purpose of the referral. Such opinions may be provided in connection with assessments conducted for, including but not limited to: <br class=\\"hard-break\\">(a) statutory accident benefits claims arising from motor vehicle accidents, including determinations under the Statutory Accident Benefits Schedule (SABS); <br class=\\"hard-break\\">(b) workplace injuries or occupational claims, including insurer, employer, or administrative referrals; <br class=\\"hard-break\\">(c) insurance-related claims outside of SABS, including disability, tort, slip-and-fall, premises liability, or similar matters; and <br class=\\"hard-break\\">(d) other medical-legal, insurance, or administrative assessment purposes, as defined by the referral source and permitted by the Contractors professional scope. Where applicable, the Contractor may provide opinions addressing the necessity, reasonableness, appropriateness, or relationship of benefits, services, limitations, or restrictions, only to the extent that such opinions fall within the Contractors regulated</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\">scope of practice and are permitted under the applicable statutory, contractual, or policy framework governing the referral. <br class=\\"hard-break\\">In all cases, the Contractors opinions shall be limited to matters properly within their professional scope of practice and shall not extend to diagnoses, determinations, or conclusions reserved to other regulated professionals or outside the Contractors regulatory authority.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Explicit Scope Exclusions <br class=\\"hard-break\\">Unless expressly permitted by the Contractors profession, training, and applicable regulatory College standards, the Contractor shall not provide treatment, therapy, rehabilitation, or therapeutic intervention of any kind; prescribe medication, recommend medication changes, or provide medication management opinions; provide diagnoses, determinations, or opinions outside the Contractors regulated scope of practice or professional authority; provide legal conclusions, determinations of liability, or opinions on legal causation; or act, directly or indirectly, as an advocate for any party, referral source, insurer, employer, or examinee. The Contractor shall not comment on credibility, malingering, exaggeration, or secondary gain unless such commentary is expressly permitted within the Contractors professional scope of practice and is supported by objective findings, accepted methodologies, and documented clinical evidence.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"