\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">IME Fee (in-clinic)&nbsp;</span></p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.base_fee\\">CA$10.00</span></span></p></td></tr></tbody></table><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Note: </strong>If hourly rate or report turnaround days are not applicable, those fields will appear empty in the generated contract.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>3. SERVICES TO BE PROVIDED&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner agrees to:&nbsp;</span><br class=\\"hard-break\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><br class=\\"hard-break\\"></p><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.some_key\\" class=\\"checkbox-group-variable\\" style=\\"margin: 12px 0px;\\"><label class=\\"font-semibold\\" style=\\"font-weight: 600; display: block; margin-bottom: 8px;\\">Some Key:</label><div class=\\"checkbox-options\\" style=\\"margin-top: 8px;\\"><div style=\\"margin-bottom: 4px; display: flex; align-items: center;\\"><span class=\\"checkbox-indicator\\" data-checkbox-value=\\"occupational_therapist\\" data-variable-key=\\"custom.some_key\\" style=\\"display: inline-block; width: 16px; height: 16px; border: 2px solid rgb(51, 51, 51); margin-right: 8px; vertical-align: middle; flex-shrink: 0;\\"></span><label style=\\"margin: 0px; font-weight: normal;\\">Occupational Therapist</label></div></div></div><p class=\\"\\"><br class=\\"hard-break\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Conduct thorough and impartial medical examinations of claimants&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Prepare detailed, objective medical reports within the agreed turnaround time&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain professional standards in accordance with medical licensing requirements&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Be available for testimony or clarification if required&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Respond to case assignments in a timely manner&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>4. PROFESSIONAL OBLIGATIONS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner shall:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain current medical licensure and malpractice insurance Comply with all applicable laws, regulations, and ethical guidelines&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Provide services in a professional, objective, and unbiased manner&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Keep the Platform informed of any changes to availability or credentials&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain patient confidentiality in accordance with applicable privacy laws&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>5. CONFIDENTIALITY&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner acknowledges that all information obtained during examinations is confidential and shall:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Not disclose any patient information except as required by law or authorized by the patient&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Maintain secure storage of all patient records and examination materials&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Comply with all applicable privacy legislation including but not limited to PIPEDA&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Return or destroy all confidential materials upon completion of services&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>6. INDEPENDENT CONTRACTOR STATUS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner is an independent contractor and not an employee of the Platform. The Examiner is responsible for:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> All applicable taxes and business registrations&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Professional liability insurance&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Business expenses including office space, equipment, and supplies&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Compliance with all professional licensing requirements&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>7. TERM AND TERMINATION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">This Agreement shall remain in effect until terminated by either party with 30 days written notice. The Platform may terminate this Agreement immediately if the Examiner:&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Breaches any material term of this Agreement&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Loses professional licensure or malpractice insurance&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Engages in professional misconduct&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Fails to maintain acceptable quality standards&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>8. LIABILITY AND INDEMNIFICATION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner agrees to maintain professional liability insurance with minimum coverage of $2,000,000 and shall indemnify the Platform against any claims arising from the Examiner's professional services or negligence.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>9. DISPUTE RESOLUTION&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Any disputes arising from this Agreement shall be resolved through mediation, and if necessary, arbitration in accordance with the laws of the Province of.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>10. GENERAL PROVISIONS&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> This Agreement constitutes the entire agreement between the parties&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> Any amendments must be made in writing and signed by both parties&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> This Agreement shall be governed by the laws of&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"> If any provision is found invalid, the remaining provisions shall continue in effect&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>ACKNOWLEDGMENT&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">By accepting cases through the Thrive IME Platform, the Examiner acknowledges that they have read, understood, and agree to be bound by the terms and conditions of this Agreement.&nbsp;</span></p><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span data-signature=\\"examiner\\">________________________</span></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Examiner Signature&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Date: </strong>________________________</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>For Platform:&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Authorized Signatory&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Reviewed At:&nbsp;</strong></span></p><p class=\\"\\"></p><p class=\\"\\" style=\\"text-align: center;\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"thrive.copyright\\"> Copyright 2026 | Thrive Assessment & Care | All Rights Reserved</span></span></p>", "effectiveDate": "2026-01-29", "renderedHtmlTimestamp": "2026-01-29T13:07:31.415Z"}		2026-01-29 13:07:32.312+00	\N	2026-01-29 13:14:48.543+00	\N	\N	\N	\N	c2e40e75-1e77-4072-8b9c-345e78dbf7a4	2026-01-29 13:07:04.801+00	2026-01-29 13:16:13.302+00	1kPbUuKbHf7uAeAgUAZv5Q7kK8k5ci545a9OQzxF3UdU	https://docs.google.com/document/d/1kPbUuKbHf7uAeAgUAZv5Q7kK8k5ci545a9OQzxF3UdU/edit	f	\N	signed-contracts/a53007e0-a0ef-4cd8-aea1-f722e5a47f25/0e923ed3-1eb1-4580-b473-a48b86b72fbd.html	9bcef877e780eccb2192d10e3a60a402e66e9549f89b5394eee8164dbe8cf9a2	contracts/contracts/a53007e0-a0ef-4cd8-aea1-f722e5a47f25/unsigned-1769692048830.html	\N	d7b65407-7fe4-4d0f-8a4c-31f813902c0a	signed-contracts/a53007e0-a0ef-4cd8-aea1-f722e5a47f25/b9e3fbd9-f59a-4d8f-856b-fffa04c308fc.pdf	109be696fbbda8c461e1d79f90971fb49df7079a770068afeea56cd5fccbc12a	\N	\N	e5b720b6-e18c-4f2b-97bd-d5e5bf9b510d	{"custom": {}, "contract": {"review_date": "2026-01-29", "effective_date": "2026-01-29"}, "e