ass=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>4. Payment Timing </strong><br class=\\"hard-break\\">Payment will be issued within <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.payment_timing\\">8</span> days of receipt of a compliant invoice and finalized report.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"></p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>SCHEDULE C</strong></h3><p class=\\"\\"><br class=\\"hard-break\\"><strong>QUALITY ASSURANCE &amp; REPORT INTEGRITY </strong><br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1. Purpose of QA Review Quality Assurance exists solely to ensure: <br class=\\"hard-break\\"> Administrative accuracy <br class=\\"hard-break\\"> Internal consistency <br class=\\"hard-break\\"> Compliance with statutory or regulatory language <br class=\\"hard-break\\"> Clarity and completeness of responses</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">2. Limited QA Authority <br class=\\"hard-break\\">The Contractor grants the Company limited agency to: <br class=\\"hard-break\\"> Correct spelling, grammar, formatting, dates, and administrative errors <br class=\\"hard-break\\"> Insert accurate document review lists where omitted <br class=\\"hard-break\\"> Request clarification of ambiguous or inconsistent statements</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Absolute Protection of Opinion <br class=\\"hard-break\\">Under no circumstances shall the Company: <br class=\\"hard-break\\"> Alter clinical opinions<br class=\\"hard-break\\"> Change diagnoses <br class=\\"hard-break\\"> Modify conclusions <br class=\\"hard-break\\"> Introduce substantive content <br class=\\"hard-break\\"><br class=\\"hard-break\\">without the Contractors express written consent.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Turnaround Expectations <br class=\\"hard-break\\"> IME Reports: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.ime_reports\\">4</span> business days <br class=\\"hard-break\\"> File Reviews: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.file_reviews\\">5</span> business days <br class=\\"hard-break\\"> Addenda: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.addenda\\">6</span> business days <br class=\\"hard-break\\"> QA responses: within <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.qa_responses\\">7</span> hours <br class=\\"hard-break\\"><br class=\\"hard-break\\">Failure to meet timelines may result in suspension of bookings.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">5. Multidisciplinary Assessments <br class=\\"hard-break\\">The Contractor agrees to: <br class=\\"hard-break\\"> Review other discipline reports <br class=\\"hard-break\\"> Permit limited cross-referencing <br class=\\"hard-break\\"> Participate in integrated summaries <br class=\\"hard-break\\"><br class=\\"hard-break\\">This is not separately billable.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"></p><p class=\\"\\" style=\\"text-align: center;\\"></p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>Schedule D</strong></h3><p class=\\"\\" style=\\"text-align: center;\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><strong>OFFICE, SAFETY &amp; ACCESSIBILITY</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\">1. Office Locations <br class=\\"hard-break\\">Primary IME Location(s): <br class=\\"hard-break\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.primary_ime_locations\\">150 John Street</span><br class=\\"hard-break\\"><br class=\\"hard-break\\">2. Accessibility &amp; Safety Compliance <br class=\\"hard-break\\">The Contractor represents that their IME location(s): <br class=\\"hard-break\\"> Comply with Accessibility for Ontarians with Disabilities Act, 2005 (AODA) requirements <br class=\\"hard-break\\"> Provide reasonable physical accessibility <br class=\\"hard-break\\"> Have emergency exits and safety procedures <br class=\\"hard-break\\"> Maintain infection control protocols <br class=\\"hard-break\\"> Provide restroom access for examinees</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Chaperone / Administrative Presence <br class=\\"hard-break\\"> Receptionist or chaperone available <br class=\\"hard-break\\"> Procedures in place for vulnerable populations</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Duty to Update <br class=\\"hard-break\\">The Contractor shall notify the Company promptly of any material change to office safety, accessibility, or availability.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>SCHEDULE E</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><strong>CREDENTIALS, INSURANCE &amp; DISCLOSURE</strong> <br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\">1. Credentials on File<br class=\\"hard-break\\"><br class=\\"hard-break\\"><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.the_contractor_shall_provide_and_maintain\\"><span data-checkbox-value=\\"current_cv\\"></span> Current CV <br/><span data-checkbox-value=\\"proof_of_college_registration\\"></span> Proof of College registration<br/><span data-checkbox-value=\\"proof_of_professional_liability_insurance\\"></span>  Proof of professional liability insurance </div></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">2. Insurance <br class=\\"hard-break\\">Minimum professional liability coverage: <br class=\\"hard-break\\">$ <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.per_occurance_aggregate\\">5</span> per occurrence/aggregate</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Ongoing Disclosure Obligations <br class=\\"hard-break\\">The Contractor must immediately disclose: <br class=\\"hard-break\\"> Any College investigation or complaint <br class=\\"hard-break\\"> Any restriction, suspension, or discipline <br class=\\"hard-break\\"> Any criminal charge relevant to practice <br class=\\"hard-break\\"> Any loss of hospital privileges (if applicable)</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Right to Suspend Assignments <br class=\\"hard-break\\">The Company may immediately suspend or terminate assignments pending review of any disclosure.</p><p class=\\"\\"></p><p cl