=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Fee&nbsp;</strong></span></p><table class=\\"border-collapse table-auto w-full\\" style=\\"min-width: 50px;\\"><colgroup><col style=\\"min-width: 25px;\\"><col style=\\"min-width: 25px;\\"></colgroup><tbody><tr><th style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top; background-color: #f3f4f6; font-weight: 600;\\" class=\\"border border-gray-300 p-2 bg-gray-100 font-semibold\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Name</strong></span></p></th><th style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top; background-color: #f3f4f6; font-weight: 600;\\" class=\\"border border-gray-300 p-2 bg-gray-100 font-semibold\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Fee</strong></span></p></th></tr><tr><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">Hourly Rate (if applicable)</span></p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.hourly_fee\\">CA$6,498,162,894,710,623,000,000.00</span></span></p></td></tr><tr><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">IME Fee (in-clinic)&nbsp;</span></p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.base_fee\\">CA$1,431,434,343,438,487,000,000.00</span></span></p></td></tr></tbody></table><p class=\\"\\"></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>Note: </strong>If hourly rate or report turnaround days are not applicable, those fields will appear empty in the generated contract.&nbsp;</span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\"><strong>3. SERVICES TO BE PROVIDED&nbsp;</strong></span></p><p class=\\"\\"><span style=\\"color: rgb(0, 0, 0);\\">The Examiner agrees to:&nbsp;</span><br class=\\"hard-break\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><br class=\\"hard-break\\"></p><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.some_key\\" class=\\"checkbox-group-variable\\" style=\\"margin: 12px 0px;\\"><label class=\\"font-semibold\\" style=\\"font-weight: 600; display: block; margin-bottom: 8px;\\">Some Key:</label><div class=\\"checkbox-options\\" style=\\"margin-top: 8px;\\"><div style=\\"margin-bottom: 4px; display: flex; align-items: center;\\"><span class=\\"checkbox-indicator\\" data-checkbox-value=\\"occupational_therapist\\" data-variable-key=\\"custom.some_key\\" style=\\"display: inline-block; width: 16px; height: 16px; border: 2px solid rgb(51, 51, 51); margin-right: 8px; vertical-align: middle; flex-shrink: 0;\\"></s