></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>4. Payment Timing </strong><br class=\\"hard-break\\">Payment will be issued within <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.payment_timing\\">8</span> days of receipt of a compliant invoice and finalized report.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"></p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>SCHEDULE C</strong></h3><p class=\\"\\"><br class=\\"hard-break\\"><strong>QUALITY ASSURANCE &amp; REPORT INTEGRITY </strong><br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1. Purpose of QA Review Quality Assurance exists solely to ensure: <br class=\\"hard-break\\"> Administrative accuracy <br class=\\"hard-break\\"> Internal consistency <br class=\\"hard-break\\"> Compliance with statutory or regulatory language <br class=\\"hard-break\\"> Clarity and completeness of responses</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">2. Limited QA Authority <br class=\\"hard-break\\">The Contractor grants the Company limited agency to: <br class=\\"hard-break\\"> Correct spelling, grammar, formatting, dates, and administrative errors <br class=\\"hard-break\\"> Insert accurate document review lists where omitted <br class=\\"hard-break\\"> Request clarification of ambiguous or inconsistent statements</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Absolute Protection of Opinion <br class=\\"hard-break\\">Under no circumstances shall the Company: <br class=\\"hard-break\\"> Alter clinical opinions<br class=\\"hard-break\\"> Change diagnoses <br class=\\"hard-break\\"> Modify conclusions <br class=\\"hard-break\\"> Introduce substantive content <br class=\\"hard-break\\"><br class=\\"hard-break\\">without the Contractors express written consent.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Turnaround Expectations <br class=\\"hard-break\\"> IME Reports: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.ime_reports\\">4</spa