p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"></p><p class=\\"\\" style=\\"text-align: center;\\"></p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>Schedule D</strong></h3><p class=\\"\\" style=\\"text-align: center;\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><strong>OFFICE, SAFETY &amp; ACCESSIBILITY</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\">1. Office Locations <br class=\\"hard-break\\">Primary IME Location(s): <br class=\\"hard-break\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.primary_ime_locations\\">150 John Street</span><br class=\\"hard-break\\"><br class=\\"hard-break\\">2. Accessibility &amp; Safety Compliance <br class=\\"hard-break\\">The Contractor represents that their IME location(s): <br class=\\"hard-break\\"> Comply with Accessibility for Ontarians with Disabilities Act, 2005 (AODA) requirements <br class=\\"hard-break\\"> Provide reasonable physical accessibility <br class=\\"hard-break\\"> Have emergency exits and safety procedures <br class=\\"hard-break\\"> Maintain infection control protocols <br class=\\"hard-break\\"> Provide restroom access for examinees</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Chaperone / Administrative Presence <br class=\\"hard-break\\"> Receptionist or chaperone available <br class=\\"hard-break\\"> Procedures in place for vulnerable populations</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Duty to Update <br class=\\"hard-break\\">The Contractor shall notify the Company promptly of any material change to office safety, accessibility, or availability.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>SCHEDULE E</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><strong>CREDENTIALS, INSURANCE &amp; DISCLOSURE</strong> <br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\">1. Credentials on File<br class=\\"hard-break\\"><br class=\\"hard-break\\"><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.the_contractor_shall_provide_and_maintain\\"><span data-checkbox-value=\\"current_cv\\"></span> Current CV <br/><span data-checkbox-value=\\"proof_of_college_registration\\"></span> Proof of College registration<br/><span data-checkbox-value=\\"proof_of_professional_liability_insurance\\"></span>  Proof of professional liability insurance </div></p><p 