ortant; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.clarification_no_fee\\">Included</span></p></td></tr><tr><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\" colwidth=\\"276\\"><p class=\\"\\">Multidisciplinary Cross-Review</p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.multidisciplinary_crossreview\\">Included</span></p></td></tr><tr><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\" colwidth=\\"276\\"><p class=\\"\\">CAT / Specialized Assessment (if applicable)</p></td><td style=\\"border: 1px solid #d1d5db; box-sizing: border-box; min-width: 1em; padding: 0.5rem; position: relative; vertical-align: top;\\" class=\\"border border-gray-300 p-2\\" colspan=\\"1\\" rowspan=\\"1\\"><p class=\\"\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.cat_specialized\\">CA$45.00</span></p></td></tr></tbody></table><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><br class=\\"hard-break\\"><strong>2. Late Cancellation / No-Show</strong> <br class=\\"hard-break\\"> Cancellation with <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.cancellation_hours\\">5</span> hours <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.cancellation_percentage\\">5</span>% of IME fee <br class=\\"hard-break\\"> No-Show: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.no_show_percentage\\">4</span>% of IME fee</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>3. Invoicing Requirements</strong><br class=\\"hard-break\\">Invoices must include: <br class=\\"hard-break\\"> Assessor name / professional corporation <br class=\\"hard-break\\"> Date(s) of service <br class=\\"hard-break\\"> Claim/reference number <br class=\\"hard-break\\"> Type of service rendered <br class=\\"hard-break\\"> Applicable tax number (if required) <br class=\\"hard-break\\"><br class=\\"hard-break\\">Payment is contingent upon: <br class=\\"hard-break\\"> Completion of services <br class=\\"hard-break\\"> Submission of compliant reports <br class=\\"hard-break\\"> Completion of QA review</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>4. Payment Timing </strong><br class=\\"hard-break\\">Payment will be issued within <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"fees.payment_timing\\">8</span> days of receipt of a compliant invoice and finalized report.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"></p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>SCHEDULE C</strong></h3><p class=\\"\\"><br class=\\"hard-break\\"><strong>QUALITY ASSURANCE &amp; REPORT INTEGRITY </strong><br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1. Purpose of QA Review Quality Assurance exists solely to ensure: <br class=\\"hard-break\\"> Administrative accuracy <br class=\\"hard-break\\"> Internal consistency <br class=\\"hard-break\\"> Compliance with statutory or regulatory language <br class=\\"hard-break\\"> Clarity and completeness of responses</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">2. Limited QA Authority <br class=\\"hard-break\\">The Contractor grants the Company limited agency to: <br class=\\"hard-break\\"> Correct spelling, grammar, formatting, dates, and administrative errors <br class=\\"hard-break\\"> Insert accurate document review lists where omitted <br class=\\"hard-break\\"> Request clarification of ambiguous or inconsistent statements</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Absolute Protection of Opinion <br class=\\"hard-break\\">Under no circumstances shall the Company: <br class=\\"hard-break\\"> Alter clinical opinions<br class=\\"hard-break\\"> Change diagnoses <br class=\\"hard-break\\"> Modify conclusions <br class=\\"hard-break\\"> Introduce substantive content <br class=\\"hard-break\\"><br class=\\"hard-break\\">without the Contractors express written consent.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Turnaround Expectations <br class=\\"hard-break\\"> IME Reports: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.ime_reports\\">4</span> business days <br class=\\"hard-break\\"> File Reviews: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.file_reviews\\">5</span> business days <br class=\\"hard-break\\"> Addenda: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.addenda\\">6</span> business days <br class=\\"hard-break\\"> QA responses: within <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.qa_responses\\">7</span> hours <br class=\\"hard-break\\"><br class=\\"hard-break\\">Failure to meet timelines may result in suspension of bookings.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">5. Multidisciplinary Assessments <br class=\\"hard-break\\">The Contractor agrees to: <br class=\\"hard-break\\"> Review other discipline reports <br class=\\"hard-break\\"> Permit limited cross-referencing <br class=\\"hard-break\\"> Participate in integrated summaries <br class=\\"hard-break\\"><br class=\\"hard-break\\">This is not separately billable.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"></p><p class=\\"\\" style=\\"text-align: center;\\"></p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>Schedule D</strong></h3><p class=\\"\\" style=\\"text-align: center;\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><strong>OFFICE, SAFETY &amp; ACCESSIBILITY</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\">1. Office Locations <br class=\\"hard-break\\">Primary IME Location(s): <br class=\\"hard-break\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.primary_ime_locations\\">150 John Street</span><br class=\\"hard-break\\"><br class=\\"hard-break\\">2. Accessibility &amp; Safety Compliance <br class=\\"hard-break\\">The Contractor represents that their IME location(s): <br class=\\"hard-break\\"> Comply with Accessibility for Ontarians with Disabilities Act, 2005 (AODA) requirements <br class=\\"hard-break\\"> Provide reasonable physical accessibility <br class=\\"hard-break\\"> Have emergency exits and safety procedures <br class=\\"hard-break\\"> Maintain infection control protocols <br class=\\"hard-break\\"> Provide restroom access for examinees</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Chaperone / Administrative Presence <br class=\\"hard-break\\"> Receptionist or chaperone available <br class=\\"hard-break\\"> Procedures in place for vulnerable populations</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Duty to Update <br class=\\"hard-break\\">The Contractor shall notify the Company promptly of any material change to office safety, accessibility, or availability.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>SCHEDULE E</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><strong>CREDENTIALS, INSURANCE &amp; DISCLOSURE</strong> <br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\">1. Credentials on File<br class=\\"hard-break\\"><br class=\\"hard-break\\"><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.the_contractor_shall_provide_and_maintain\\"><span data-checkbox-value=\\"current_cv\\"></span> Current CV <br/><span data-checkbox-value=\\"proof_of_college_registration\\"></span> Proof of College registration<br/><span data-checkbox-value=\\"proof_of_professional_liability_insurance\\"></span>  Proof of professional liability insurance </div></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">2. Insurance <br class=\\"hard-break\\">Minimum professional liability coverage: <br class=\\"hard-break\\">$ <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.per_occurance_aggregate\\">5</span> per occurrence/aggregate</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Ongoing Disclosure Obligations <br class=\\"hard-break\\">The Contractor must immediately disclose: <br class=\\"hard-break\\"> Any College investigation or complaint <br class=\\"hard-break\\"> Any restriction, suspension, or discipline <br class=\\"hard-break\\"> Any criminal charge relevant to practice <br class=\\"hard-break\\"> Any loss of hospital privileges (if applicable)</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Right to Suspend Assignments <br class=\\"hard-break\\">The Company may immediately suspend or terminate assignments pending review of any disclosure.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p>", "effectiveDate": "2026-02-10", "renderedHtmlTimestamp": "2026-02-10T14:10:16.865Z"}		2026-02-10 14:10:17.763+00	\N	2026-02-10 14:11:51.969+00	\N	\N	\N	\N	c2e40e75-1e77-4072-8b9c-345e78dbf7a4	2026-02-10 14:10:08.262+00	2026-02-10 14:11:51.972+00	1_KWU1t-NKuUChLe4IK47obocFXizgqHDZs-83oLhKSM	https://docs.google.com/document/d/1_KWU1t-NKuUChLe4IK47obocFXizgqHDZs-83oLhKSM/edit	f	\N	signed-contracts/2dc7af58-13ac-48f3-87aa-30fb1984ca17/b223df28-075e-4263-9def-dbcd106e879e.html	9d9880289662066f9b96be6b4b603a63ed94f9c70713182bf2c92f8ea6ce22ea	contracts/contracts/2dc7af58-13ac-48f3-87aa-30fb1984ca17/unsigned-1770732613585.html	\N	f6a1ed9d-005a-47e2-b3c5-2fe2fa4d3a51	signed-contracts/2dc7af58-13ac-48f3-87aa-30fb1984ca17/dcf5cbc8-e4f7-4e04-bba9-4c3d2209255f.pdf	f0a5546b61c91207d0e2bf323a5610d9ce2840f3eb98c0d4672359605f92334f	\N	\N	d6a8fa74-5890-437a-a23f-f9b972e3369a	{"custom": {"addenda": "6", "ime_reports": "4", "file_reviews": "5", "qa_responses": "7", "thrive_admin_name": "Bashir Syed", "cancellation_hours": "5", "primary_discipline": ["occupational_therapist", "chiropractor", "physician"], "thrive_admin_title": "Admin", "regulatory_college_s": "Bla Bla Bla ...", "primary_ime_locations": "150 John Street", "per_occurance_aggregate": "5", "specialty_specific_notes": "Bla Bla Bla ........", "license_registration_number_s": "Bla Bla Bla .....", "the_contractor_shall_provide_and_maintain": ["current_cv", "proof_of_college_registration", "proof_of_professional_liability_insurance"]}, "contract": {"effective_date": "2026-02-10"}, "examiner": {"name": "Mahroz Abbas", "email": "mahroz+5q@buildmeapp.io", "signature": "data:image/png;base64,", "checkbox_selections": {}, "signature_date_time": "2026-02-10T14:11:43.584Z"}, "fees_overrides": {"inperson_fee": 15, "payment_timing": "8", "cat_specialized": 45, "virtual_ime_fee": 20, "file_paper_review": 23, "no_show_percentage": "4", "clarification_no_fee": "included", "cancellation_percentage": "5", "addendum_new_evidence_only": 30, "multidisciplinary_crossreview": "included"}}	\N
2c75ce24-5e91-43e4-a798-4b4486aafa40	\N	47252244-a710-468e-9436-9ce2bbdd8822	99f4de7e-5d8d-4818-9750-d74942c1c4f5	SENT	{"fees": {"inperson_fee": 15, "payment_timing": "8", "cat_specialized": 45, "virtual_ime_fee": 20, "file_paper_review": 23, "no_show_percentage": "4", "clarification_no_fee": "included", "cancellation_percentage": "5", "addendum_new_evidence_only": 30, "multidisciplinary_crossreview": "included"}, "thrive": {}, "contract": {"effective_date": "2026-02-09"}, "examiner": {"name": "Gail Church", "email": "gail@mailinator.com"}, "province": "", "examinerName": "Gail Church", "feeStructure": {"IMEFee": 20, "hourlyRate": 0, "paymentTerms": "8", "cancellationFee": 5, "recordReviewFee": null}, "renderedHtml": "<p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\" style=\\"text-align: center;\\"></p><p class=\\"\\"></p><h2 style=\\"text-align: center;\\">INDEPENDENT MEDICAL EXAMINATION (IME) CONTRACTOR AGREEMENT</h2><p class=\\"\\"><br class=\\"hard-break\\">This Independent Medical Examination Contractor Agreement (the Agreement) is made as of <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"contract.effective_date\\">2026-02-09</span>(the <strong>Effective Date</strong>)</p><p class=\\"\\"></p><p class=\\"\\"><strong>BETWEEN:</strong><br class=\\"hard-break\\"><strong>Thrive Assessment &amp; Care Inc., </strong><br class=\\"hard-break\\">an Ontario corporation, <br class=\\"hard-break\\">having its principal place of business at <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"thrive.company_address\\">1 Dundas St West, Suite 2500, Toronto, ON., M5G 1Z3</span>(the <strong>Company</strong>) <br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>AND:</strong> <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_name\\">Gail Church</span><p class=\\"\\">,an independent regulated health professional and/or professional corporation, having its <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_city\\">Campbellton</span>principal place of business at (the <strong>Contractor</strong>) <br class=\\"hard-break\\">The Company and the Contractor are referred to individually as a <strong>Party</strong> and collectively as the <strong>Parties.</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>RECITALS</strong><br class=\\"hard-break\\"><br class=\\"hard-break\\">A. The Company arranges and administers independent medical, psychological, functional, and rehabilitation-related examinations and assessments for insurers, employers, lawyers, tribunals, and other third-party referral sources. <br class=\\"hard-break\\">B. The Contractor is duly qualified, licensed, and experienced to provide independent examination services within the Contractors professional scope of practice. <br class=\\"hard-break\\">C. The Company wishes to retain the Contractor, and the Contractor wishes to provide such services, strictly as an independent contractor, subject to the terms and conditions of this Agreement.</p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\">NOW THEREFORE, in consideration of the mutual covenants contained herein, the Parties agree as follows:<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>1. NATURE OF RELATIONSHIP</strong> <br class=\\"hard-break\\">1.1 Independent Contractor <br class=\\"hard-break\\">The Contractor is an independent contractor and not an employee, agent, partner, or joint venturer of the Company. Nothing in this Agreement shall be construed to create an employment relationship. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1.2 No Authority <br class=\\"hard-break\\">The Contractor has no authority to bind the Company, incur obligations on behalf of the Company, or represent themselves as an employee or agent of the Company. <br class=\\"hard-break\\"><br class=\\"hard-break\\">1.3 Taxes and Deductions <br class=\\"hard-break\\">The Contractor is solely responsible for all taxes, remittances, statutory deductions, premiums, and contributions arising from amounts paid under this Agreement, including but not limited to income tax, HST, CPP, EI, WSIB, and EHT.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><br class=\\"hard-break\\"><strong>2. SCOPE OF SERVICES</strong> <br class=\\"hard-break\\">2.1 IME Services <br class=\\"hard-break\\">The Contractor shall provide independent examination-related services, which may include in-person or virtual examinations, file reviews, addenda, clarifications, and participation in multidisciplinary assessments, strictly within the Contractors professional scope of practice, as further defined in Schedule A (Discipline &amp; Scope of Practice).<br class=\\"hard-break\\"><br class=\\"hard-break\\">2.2 No Treatment Relationship <br class=\\"hard-break\\">The Contractor shall not provide treatment, therapy, medical advice, rehabilitation services, or ongoing care to any examinee and shall not establish a therapeutic, physicianpatient, or clinicianpatient relationship.<br class=\\"hard-break\\"><br class=\\"hard-break\\">2.3 Consent and Identification <br class=\\"hard-break\\">The Contractor shall obtain informed consent prior to each assessment and verify examinee identity in accordance with applicable professional, legal, and regulatory standards.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>3. PROFESSIONAL INDEPENDENCE, OBJECTIVITY, AND DUTY OF IMPARTIALITY</strong> <br class=\\"hard-break\\">3.1 Independence of Opinion <br class=\\"hard-break\\">The Contractor shall render opinions that are honest, impartial, objective, and independent, based solely on professional expertise, examination findings, and reviewed documentation.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\">3.2 No Outcome Influence <br class=\\"hard-break\\">Compensation under this Agreement is not contingent on the substance, outcome, or conclusions of any opinion, determination, or report. <br class=\\"hard-break\\"><br class=\\"hard-break\\">3.3 No Direction on Conclusions <br class=\\"hard-break\\">The Company shall not direct, influence, or interfere with the Contractors professional opinions or conclusions.<br class=\\"hard-break\\"><br class=\\"hard-break\\">3.4 Duty of Independence and Impartiality (Rule 53.03Style Clause) <br class=\\"hard-break\\">The Contractor acknowledges that where any opinion, report, or assessment prepared under this Agreement is relied upon in a judicial, arbitral, or administrative proceeding, the Contractors primary duty is to provide opinions that are fair, objective, and non-partisan. <br class=\\"hard-break\\">The Contractor agrees that such opinions shall be given in accordance with the Contractors professional expertise and independent judgment, and not as an advocate for the Company, any referral source, insurer, employer, examinee, or any other party. <br class=\\"hard-break\\">The Contractor further acknowledges that this duty of independence and impartiality prevails over any obligation owed to the Company or any referral source with respect to the substance of the opinions expressed.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>4. REGULATORY COMPLIANCE </strong><br class=\\"hard-break\\">4.1 Licensure and Good Standing <br class=\\"hard-break\\">The Contractor represents and warrants that they are, and shall remain throughout the term of this Agreement, duly licensed, registered, and in good standing with the applicable regulatory College(s). <br class=\\"hard-break\\"><br class=\\"hard-break\\">4.2 Mandatory Disclosure <br class=\\"hard-break\\">The Contractor shall immediately notify the Company in writing of:<br class=\\"hard-break\\"> any investigation, complaint, inquiry, restriction, suspension, or disciplinary action;</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"> any criminal charge or conviction relevant to professional practice; or <br class=\\"hard-break\\"> any loss, limitation, or change in professional registration, certification, or hospital privileges. <br class=\\"hard-break\\"><br class=\\"hard-break\\">4.3 Standards of Practice <br class=\\"hard-break\\">The Contractor shall comply with all applicable laws, regulations, College standards, professional guidelines, and ethical obligations.</p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>5. CONFLICT OF INTEREST</strong> <br class=\\"hard-break\\">5.1 No Conflict <br class=\\"hard-break\\">The Contractor shall not conduct an assessment where a conflict of interest exists, including prior treatment, personal relationship, or financial interest involving the examinee. <br class=\\"hard-break\\"><br class=\\"hard-break\\">5.2 Disclosure and Reassignment <br class=\\"hard-break\\">Any actual or potential conflict must be disclosed immediately. The Company may reassign or cancel the assessment without penalty.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>6. CONFIDENTIALITY AND PRIVACY </strong><br class=\\"hard-break\\">6.1 Confidential Information The Contractor shall keep confidential all information relating to the Company, referral sources, and examinees, except as required by law. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.2 Privacy Legislation <br class=\\"hard-break\\">The Contractor shall comply with all applicable privacy legislation, including the Personal Health Information Protection Act (Ontario) and PIPEDA, and shall implement appropriate administrative, technical, and physical safeguards. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.3 Use Limitation <br class=\\"hard-break\\">Personal health information shall be used solely for the purpose of fulfilling obligations under this Agreement and shall not be retained, reused, or disclosed for any other purpose. <br class=\\"hard-break\\"><br class=\\"hard-break\\">6.4 Breach Notification <br class=\\"hard-break\\">Any actual or suspected privacy breach shall be reported to the Company immediately upon discovery.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\"><strong>7. QUALITY ASSURANCE AND REPORT INTEGRITY </strong><br class=\\"hard-break\\">7.1 Limited QA Authority <br class=\\"hard-break\\">The Contractor acknowledges that the Company may conduct quality assurance review for formatting, clarity, internal consistency, administrative accuracy, and statutory or regulatory language compliance, as further set out in Schedule C (QA &amp; Report Integrity). <br class=\\"hard-break\\"><br class=\\"hard-break\\">7.2 No Opinion Alteration <br class=\\"hard-break\\">Under no circumstances shall the Company alter the Contractors clinical opinions or conclusions without the Contractors express written consent.<br class=\\"hard-break\\"><br class=\\"hard-break\\">7.3 Clarifications <br class=\\"hard-break\\">The Contractor shall cooperate reasonably and promptly in providing clarifications or corrections consistent with Schedule C.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>8. FEES AND PAYMENT</strong> <br class=\\"hard-break\\">8.1 Fees <br class=\\"hard-break\\">Fees and billing terms are set out in Schedule B (Fees &amp; Billing).<br class=\\"hard-break\\"><br class=\\"hard-break\\">8.2 Invoicing <br class=\\"hard-break\\">Invoices shall be submitted in accordance with Schedule B. Payment is conditional upon completion of services and submission of compliant deliverables. <br class=\\"hard-break\\"><br class=\\"hard-break\\">8.3 No Additional Compensation <br class=\\"hard-break\\">No compensation shall be payable unless expressly set out in Schedule B.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>9. INTELLECTUAL PROPERTY </strong><br class=\\"hard-break\\">9.1 Work Product Ownership <br class=\\"hard-break\\">All reports and deliverables prepared under this Agreement are commissioned works and shall be the property of the Company upon payment.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"><br class=\\"hard-break\\">9.2 Professional Authorship <br class=\\"hard-break\\">Nothing in this Agreement alters the Contractors professional responsibility for, or authorship of, the opinions expressed in any report. <br class=\\"hard-break\\"><br class=\\"hard-break\\">9.3 Restriction on Reuse <br class=\\"hard-break\\">The Contractor shall not reuse, publish, or disclose reports prepared under this Agreement without the Companys prior written consent, except as required by law.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>10. INSURANCE AND INDEMNIFICATION </strong><br class=\\"hard-break\\">10.1 Insurance <br class=\\"hard-break\\">The Contractor shall maintain professional liability insurance in amounts customary for their profession and provide proof upon request. <br class=\\"hard-break\\"><br class=\\"hard-break\\">10.2 Indemnification by Contractor <br class=\\"hard-break\\">The Contractor shall indemnify and hold harmless the Company from all claims, losses, damages, costs, and expenses arising from the Contractors professional acts, omissions, breaches of this Agreement, or violations of law. <br class=\\"hard-break\\"><br class=\\"hard-break\\">10.3 Indemnification by Company <br class=\\"hard-break\\">The Company shall indemnify the Contractor for losses arising solely from the Companys negligence or willful misconduct.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>11. TERMINATION</strong> <br class=\\"hard-break\\">11.1 Termination Without Cause</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">Either Party may terminate this Agreement upon thirty (30) days written notice. <br class=\\"hard-break\\"><br class=\\"hard-break\\">11.2 Immediate Termination <br class=\\"hard-break\\">The Company may terminate this Agreement immediately upon: <br class=\\"hard-break\\"> loss or restriction of licensure; <br class=\\"hard-break\\"> material breach of this Agreement; <br class=\\"hard-break\\"> privacy breach or professional misconduct; or <br class=\\"hard-break\\"> conduct reasonably bringing the Company into disrepute.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\">11.3 Survival <br class=\\"hard-break\\">Confidentiality, privacy, indemnity, ownership, and duty of independence provisions survive termination.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>12. NON-SOLICITATION</strong> <br class=\\"hard-break\\">During the term of this Agreement and for twelve (12) months thereafter, the Contractor shall not solicit the Companys referral sources or staff, except through the Company.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>13. GOVERNING LAW AND JURISDICTION </strong><br class=\\"hard-break\\">This Agreement shall be governed by the laws of the Province of Ontario and the laws of Canada applicable therein. The Parties attorn to the exclusive jurisdiction of the courts of Ontario.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>14. GENERAL </strong><br class=\\"hard-break\\">14.1 Entire Agreement <br class=\\"hard-break\\">This Agreement, together with its Schedules, constitutes the entire agreement between the Parties. <br class=\\"hard-break\\"><br class=\\"hard-break\\">14.2 Amendments <br class=\\"hard-break\\">Any amendment must be in writing and signed by both Parties. <br class=\\"hard-break\\"><br class=\\"hard-break\\">14.3 Severability <br class=\\"hard-break\\">If any provision is held invalid, the remaining provisions remain in full force. <br class=\\"hard-break\\"><br class=\\"hard-break\\">14.4 Counterparts and Electronic Execution <br class=\\"hard-break\\">This Agreement may be executed in counterparts and by electronic signature.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>SCHEDULES</strong> <br class=\\"hard-break\\"> Schedule A  Discipline &amp; Scope of Practice <br class=\\"hard-break\\"> Schedule B  Fees &amp; Billing</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"> Schedule C  Quality Assurance &amp; Report Integrity <br class=\\"hard-break\\"> Schedule D  Office, Safety &amp; Accessibility <br class=\\"hard-break\\"> Schedule E  Credentials, Insurance &amp; Disclosure</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>EXECUTION</strong> <br class=\\"hard-break\\">IN WITNESS WHEREOF, the Parties have executed this Agreement as of the Effective Date. <br class=\\"hard-break\\"><strong>THRIVE ASSESSMENT &amp; CARE INC.</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">By:__________________________</p><p class=\\"\\">Name: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.thrive_admin_name\\">Bashir Syed</span><br class=\\"hard-break\\">Title: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.thrive_admin_title\\">Admin</span><br class=\\"hard-break\\"><br class=\\"hard-break\\">Date:<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>Contractor</strong></p><p class=\\"\\">By:</p><p class=\\"\\"><img src=\\"data:image/png;base64,\\" alt=\\"Examiner Signature\\" data-signature=\\"examiner\\" style=\\"max-width: 240px; height: auto; display: inline-block;\\" /></p><p class=\\"\\">Name: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_name\\">Gail Church</span></p><p class=\\"\\">Title(if applicable)</p><p class=\\"\\">Date: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"application.examiner_signature_date_time\\">February 9, 2026 at 5:01 PM</span></p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>SCHEDULE A</strong></h3><p class=\\"\\"></p><p class=\\"\\"><strong>DISCIPLINE &amp; SCOPE OF PRACTICE</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement.<br class=\\"hard-break\\"><br class=\\"hard-break\\"><strong>1. Contractor Discipline</strong></p><p class=\\"\\"><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.primary_discipline\\"><span data-checkbox-value=\\"occupational_therapist\\"></span> Occupational Therapist<br/><span data-checkbox-value=\\"physiotherapist\\"></span> Physiotherapist <br/><span data-checkbox-value=\\"chiropractor\\"></span> Chiropractor <br/><span data-checkbox-value=\\"physician\\"></span> Physician<br/><span data-checkbox-value=\\"psychologist\\"></span> Psychologist<br/><span data-checkbox-value=\\"neuropsychologist\\"></span> Neuropsychologist<br/><span data-checkbox-value=\\"other\\"></span> Other</div><br class=\\"hard-break\\"><br class=\\"hard-break\\">Regulatory College(s): <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.regulatory_college_s\\">Bla Bla Bla ...</span><br class=\\"hard-break\\">License / Registration Number(s): <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.license_registration_number_s\\">Bla Bla Bla .....</span></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>2. Permitted Scope of IME Opinions</strong><br class=\\"hard-break\\">The Contractor is authorized to provide independent medical, psychological, functional, or rehabilitation-related opinions within the Contractors professional scope of practice, training, competence, and regulatory authority, as applicable to the purpose of the referral. Such opinions may be provided in connection with assessments conducted for, including but not limited to: <br class=\\"hard-break\\">(a) statutory accident benefits claims arising from motor vehicle accidents, including determinations under the Statutory Accident Benefits Schedule (SABS); <br class=\\"hard-break\\">(b) workplace injuries or occupational claims, including insurer, employer, or administrative referrals; <br class=\\"hard-break\\">(c) insurance-related claims outside of SABS, including disability, tort, slip-and-fall, premises liability, or similar matters; and <br class=\\"hard-break\\">(d) other medical-legal, insurance, or administrative assessment purposes, as defined by the referral source and permitted by the Contractors professional scope. Where applicable, the Contractor may provide opinions addressing the necessity, reasonableness, appropriateness, or relationship of benefits, services, limitations, or restrictions, only to the extent that such opinions fall within the Contractors regulated</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><p class=\\"\\">scope of practice and are permitted under the applicable statutory, contractual, or policy framework governing the referral. <br class=\\"hard-break\\">In all cases, the Contractors opinions shall be limited to matters properly within their professional scope of practice and shall not extend to diagnoses, determinations, or conclusions reserved to other regulated professionals or outside the Contractors regulatory authority.</p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Explicit Scope Exclusions <br class=\\"hard-break\\">Unless expressly permitted by the Contractors profession, training, and applicable regulatory College standards, the Contractor shall not provide treatment, therapy, rehabilitation, or therapeutic intervention of any kind; prescribe medication, recommend medication changes, or provide medication management opinions; provide diagnoses, determinations, or opinions outside the Contractors regulated scope of practice or professional authority; provide legal conclusions, determinations of liability, or opinions on legal causation; or act, directly or indirectly, as an advocate for any party, referral source, insurer, employer, or examinee. The Contractor shall not comment on credibility, malingering, exaggeration, or secondary gain unless such commentary is expressly permitted within the Contractors professional scope of practice and is supported by objective findings, accepted methodologies, and documented clinical evidence.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Specialty-Specific Notes (Optional) <br class=\\"hard-break\\">(Used only if required for a given discipline)<br class=\\"hard-break\\"><span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.specialty_specific_notes\\">Bla Bla Bla ........</span><br class=\\"hard-break\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><div class=\\"page-break\\"></div><h3 style=\\"text-align: center;\\"><strong>SCHEDULE B</strong></h3><p class=\\"\\"></p><p class=\\"\\"><strong>FEES &amp; BILLING</strong><br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement.<br class=\\"hard-break\\"><strong>1. Fee Structure</strong><br class=\\"hard-break\\">(All amounts exclusive of HST, where applicable)</p><table class=\\"border-collapse table-auto w-full\\" style=\\"min-width: 301px;\\"><colgroup><col style=\\"width: 276px;\\"><col style=\\"min-width: 25px;\\"></colgroup><tbody><tr><th style=\\"border: 1px solid #d1d5db; box-sizing