ted QA Authority <br class=\\"hard-break\\">The Contractor grants the Company limited agency to: <br class=\\"hard-break\\"> Correct spelling, grammar, formatting, dates, and administrative errors <br class=\\"hard-break\\"> Insert accurate document review lists where omitted <br class=\\"hard-break\\"> Request clarification of ambiguous or inconsistent statements</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Absolute Protection of Opinion <br class=\\"hard-break\\">Under no circumstances shall the Company: <br class=\\"hard-break\\"> Alter clinical opinions<br class=\\"hard-break\\"> Change diagnoses <br class=\\"hard-break\\"> Modify conclusions <br class=\\"hard-break\\"> Introduce substantive content <br class=\\"hard-break\\"><br class=\\"hard-break\\">without the Contractors express written consent.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Turnaround Expectations <br class=\\"hard-break\\"> IME Reports: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.ime_reports\\">4</span> business days <br class=\\"hard-break\\"> File Reviews: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.file_reviews\\">5</span> business days <br class=\\"hard-break\\"> Addenda: <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.addenda\\">6</span> business days <br class=\\"hard-break\\"> QA responses: within <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.qa_responses\\">7</span> hours <br class=\\"hard-break\\"><br class=\\"hard-break\\">Failure to meet timelines may result in suspension of bookings.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">5. Multidisciplinary Assessments <br class=\\"hard-break\\">The Contractor agrees to: <br class=\\"hard-break\\"> Review other discipline reports <br class=\\"hard-break\\"> Permit limited cross-referencing <br class=\\"hard-break\\"> Participate in integrated summaries <br class=\\"hard-break\\"><br class=\\"hard-break\\">This is not separately billable.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\">