lations</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Duty to Update <br class=\\"hard-break\\">The Contractor shall notify the Company promptly of any material change to office safety, accessibility, or availability.</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\"><strong>SCHEDULE E</strong></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"><br class=\\"hard-break\\"><strong>CREDENTIALS, INSURANCE &amp; DISCLOSURE</strong> <br class=\\"hard-break\\">This Schedule forms part of the Independent Medical Examination (IME) Contractor Agreement. <br class=\\"hard-break\\">1. Credentials on File<br class=\\"hard-break\\"><br class=\\"hard-break\\"><div data-variable-type=\\"checkbox_group\\" data-variable-key=\\"custom.the_contractor_shall_provide_and_maintain\\"><span data-checkbox-value=\\"current_cv\\"></span> Current CV <br/><span data-checkbox-value=\\"proof_of_college_registration\\"></span> Proof of College registration<br/><span data-checkbox-value=\\"proof_of_professional_liability_insurance\\"></span>  Proof of professional liability insurance </div></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">2. Insurance <br class=\\"hard-break\\">Minimum professional liability coverage: <br class=\\"hard-break\\">$ <span style=\\"display: inline; border-bottom: 2px solid black; background: none !important; color: inherit !important; padding: 0 !important; border-radius: 0 !important; font-weight: normal;\\" title=\\"custom.per_occurance_aggregate\\">5</span> per occurrence/aggregate</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">3. Ongoing Disclosure Obligations <br class=\\"hard-break\\">The Contractor must immediately disclose: <br class=\\"hard-break\\"> Any College investigation or complaint <br class=\\"hard-break\\"> Any restriction, suspension, or discipline <br class=\\"hard-break\\"> Any criminal charge relevant to practice <br class=\\"hard-break\\"> Any loss of hospital privileges (if applicable)</p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><p class=\\"\\"></p><hr style=\\"border: none; border-top: 1px solid #d1d5db; margin: 1rem 0;\\"<p class=\\"\\">4. Right to Suspend Assignments <br class=\\"hard-break\\">The Company may immediately suspend or terminate assignments pending review of any disclosure.</p><p class=\