67a25fbd-5ae6-409e-ba15-8d7f2c7fcf08	a99e5af9-bb35-421c-8791-939b3821b512	1	Reset Your Password - Thrive Admin	<!DOCTYPE html>\n<html lang="en">\n  <head>\n    <meta charset="UTF-8" />\n    <meta name="viewport" content="width=device-width, initial-scale=1.0" />\n    <title>Reset Your Password - Thrive Admin</title>\n    <style>\n      body {\n        font-family: Arial, sans-serif;\n        background-color: #f4f4f4;\n        margin: 0;\n        padding: 0;\n      }\n      .container {\n        max-width: 600px;\n        margin: 0 auto;\n        background-color: #ffffff;\n        padding: 20px;\n        border-radius: 10px;\n        box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\n      }\n      .header {\n        text-align: center;\n      }\n      .header img {\n        width: 120px;\n      }\n      .body {\n        margin-top: 20px;\n        font-size: 16px;\n        color: #333333;\n      }\n      .body p {\n        margin-bottom: 20px;\n        line-height: 1.6;\n      }\n      .button-container {\n        text-align: center;\n        margin: 30px 0;\n      }\n      .button {\n        display: inline-block;\n        padding: 14px 32px;\n        background: linear-gradient(90deg, #00A8FF 0%, #01F4C8 100%);\n        color: #ffffff;\n        text-decoration: none;\n        border-radius: 50px;\n        font-weight: 600;\n        font-size: 16px;\n      }\n      .footer {\n        margin-top: 30px;\n        padding-top: 20px;\n        border-top: 1px solid #e0e0e0;\n        font-size: 14px;\n        color: #777777;\n        text-align: center;\n      }\n      .note {\n        margin-top: 20px;\n        padding: 15px;\n        background-color: #f9f9f9;\n        border-left: 4px solid #00A8FF;\n        font-size: 14px;\n        color: #555555;\n      }\n      .footer a {\n        color: #00A8FF;\n        text-decoration: none;\n      }\n      .footer a:hover {\n        text-decoration: underline;\n      }\n    </style>\n  </head>\n  <body>\n    <div class="container">\n      <div class="header">\n        <img\n          src="{{CDN_URL}}/images/thriveLogo.png"\n          alt="Thrive Logo" />\n      </div>\n      <div class="body">\n        <p>Hi {{firstName}},</p>\n        <p>\n          We received a request to reset your password for your Thrive Admin\n          account. If you made this request, click the button below to\n          set a new password:\n        </p>\n        <div class="button-container">\n          <a href="{{resetLink}}" class="button" style="display: inline-block; padding: 14px 32px; background: linear-gradient(90deg, #00A8FF 0%, #01F4C8 100%); color: #ffffff; text-decoration: none; border-radius: 50px; font-weight: 600; font-size: 16px;">Reset Your Password</a>\n        </div>\n        <div class="note">\n          <strong>Note:</strong> This password reset link will expire in 1 hour\n          for security reasons. If you didn't request a password reset, you can\n          safely ignore this email.\n        </div>\n      </div>\n      <div class="footer">\n        <p>\n          If you have any questions or need assistance, feel free to contact us\n          at\n          <a href="mailto:support@thrivenetwork.ca">support@thrivenetwork.ca</a>.\n        </p>\n        <p> 2025 Thrive Assessment & Care. All rights reserved.</p>\n      </div>\n    </div>\n  </body>\n</html>	{}	\N	2025-12-17 16:14:47.218+00	\N
